import React from "react";

function ViewServicesForm({ services }) {
  return (
    <div>
      <h2>View Services</h2>

      <div className="card-container">
        {services.map((service) => (
          <div className="card" key={service.id}>
            <h3>{service.parkingService}</h3>
            <h4>{service.nameOfService}</h4>
            <p>Location: {service.location}</p>
            <p>Price: {service.price}</p>
            <p>Availability: {service.availability}</p>
            <p>Description: {service.description}</p>
            <img src={service.image} alt={service.nameOfService} />
            <p>Slot: {service.slot}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ViewServicesForm;
